message:
❗️Виталий Кличко рассказал об усилиях властей Киева:

- Делается все для обеспечения теробороны;

- Работает Гуманитарный штаб, оставшийся с «коронавирусных» локдаунов;

- Продукты, лекарства и т.п. сначала - для одиноких и пожилых, матерей с детьми;

- Помогает бизнес (подключайтесь!);

- Создана платформа для коммуникации и поддержки - лекарства, продукты, транспорт, волонтерство: potreby.kyivcity.gov.ua

Киев. Главное. Политика

❗️ Ситуация с мостами в Киеве:
- Патона и Дарницкий - перекрыты, проезд невозможен;
- Южный - проезд свободен, 1 блокпост;
- Северный - относительно свободен, 4 блокпоста.

Информация от нардепа от "СН" Юлии Гришиной

Киев. Главное. Политика

❗️Подробности о мобилизации:

▪️Мобилизация проводится во всех областях Украины кроме Луганской и Донецкой;
▪️Срок проведения: в течение 90 суток со дня вступления в силу настоящего Указа;
▪️Призыв военнообязанных, резервистов и т.д. осуществляется в объемах, определенных согласно мобилизационным планам;
▪️Главам областных государственных администраций поручено обеспечить создание и работу областных, районных и городских медицинских комиссий.

©️Инсайдер UA

Важная информация от «Укрзализныци». В связи с опасной ситуацией отменяются поезда:

- №778/777 сообщением Киев – Шостка с 25 февраля в обоих направлениях;
- №784/783 сообщением Киев – Шостка отменяется отправлением из Киева с 25 февраля, из Шостки – с 26 февраля;
- №780/777 Киев – Сумы отменяется с 25 февраля в обоих направлениях.

Киев. Главное. Политика / 👉Предложить новость

❗️Условия чрезвычайного положения, которые будут введены в Киеве

Сообщил Кличко:
- если передвигаться по городу, нужно всегда иметь документ, удостоверяющий личность;
- дискотекам, ночным клубам, ресторанам и кафе разрешат работать только с 7 утра до 23 вечера;
- на основных въездах в Киев установят контрольно-пропускные пункты;
- особый контроль будет внедрен за пассажирами на железнодорожном вокзале и в аэропорту «Киев»;
Также усиливается охрана объектов критической инфраструктуры и зданий органов власти. К последним ограничат доступ.
Патрулировать улицы правоохранителям будет помогать сотрудники Муниципальной варты.
Комендантского часа нет.

